Self study 
Meditation 
Self reflection 
Observing patterns 
Befriending yourself 
Holding self in compassion 
Discovering your true nature 
Nonjudgmental observation
Welcoming perceived flaws & limitations 
Looking at the shadow side of self

Niyama means observance, in particular, observance of our own personal ethics and attitudes towards ourselves. The niyamas lay out five principles for caring for ourselves from the inside out. Svadhyaya is the fourth of five Niyamas in the Yoga Sutras of Patanjali. #journeytoselfdiscovery";}i:30;a:1:{s:14:"comments_count";i:1;}i:31;a:1:{s:11:"likes_count";i:0;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuwPUXDl5I";}i:33;a:1:{s:5:"image";s:250:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118768026_3198943556880262_5102466009593714030_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=nrq_jfRE6nkAX_7pQPN&oh=3c93518cd6ed92820c4940163d8fe402&oe=5F7B2976";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:180664177;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2391060190940931219";}i:40;a:1:{s:10:"short_code";s:11:"CEuwJNFnKST";}i:41;a:1:{s:12:"created_time";i:1599256608;}i:42;a:1:{s:7:"caption";s:1389:"I clearly recall that I was always chosen to represent my school in almost all external speaking presentations when I was in primary school.

What I loved to do most was reading and I was good at it, so I read most speeches for the school. 

Then I got into secondary school and I became petrified. The last thing I wanted to do was speak in public. I never did. Years later I became a pastor's wife and I was expected to speak as the occasion presented itself. 
It's been over 20 years and I remember my first sermon. It was 5 minutes and it was delivered with a lot of trembling. It was terrible. Today I can laugh at myself and confidently say I have grown through the years. 
I imagined that if I had remained consistent after primary school, I would have developed more expertise and confidence to do better than I did. 
 If I took anything away from the just concluded IMC, it is this "consistency compounds". 
You can start out from the floor, but with consistency and dedication you can horn your skills and you'll get to the top. 
Whatever you do, keep doing it keep improving, keep at it, your faithfulness will pay off sooner or later. 
What's that area you wish you remained consistent with?

